#include <iostream>
#include <algorithm>
#include <queue>
using namespace std;

#define MAX_S 101

int N, H;
int graph[MAX_S][MAX_S];
bool visited[MAX_S][MAX_S] = { false, };
int min_value = 0, max_value = 101;
struct State
{
	int y, x;
};
queue<State> q;

int dx[4] = { 1,0,-1,0 };
int dy[4] = { 0,1,0,-1 };
int state_count = 0, high_state_count = 0;

bool isInside(int ny, int nx)
{
	return 0 <= ny && 0 <= nx && ny < N && nx < N;
}

void changeLowState(int high)
{
	// 각 state를 돌면서 H보다 낮은 State는 방문처리
	for (int i = 0; i < N; i++)
		for (int j = 0; j < N; j++)
		{
			if(graph[i][j]<=high)
				visited[i][j] = true;
		}
}

void bfs()
{
	//들어온 자리 큐에서 빼서 state에 저장
	while (!q.empty())
	{
		int x = q.front().x;
		int y = q.front().y;
		q.pop();
		// 방문하고 방문처리
		visited[y][x] = true;

		// 좌우상하 이동가능한 자리 탐색
		for (int i = 0; i < 4; i++)
		{
			int nx = x + dx[i];
			int ny = y + dy[i];
			if (isInside(ny, nx) && !visited[ny][nx])
			{
				visited[ny][nx] = true;
				q.push({ ny,nx });
			}
		}
	}
}

void solution()
{
	// 0<H<101
	for (int i = min_value; i < max_value; i++)
	{
	// H보다 낮은 지역 방문 불가처리 changeLowState
		changeLowState(i);
	// for문으로 각 STate 탐색
		for(int i=0; i<N; i++)
			for (int j = 0; j < N; j++)
			{
	// 방문 가능한 지역 BFS탐색, 큐에 그 지역 넣기
				if (visited[i][j] == false)
				{
					q.push({ i,j });
					bfs();
	// BFS탐색마다 영역개수 +1
					state_count++;
				}
		
			}

	// high_state_count 갱신
		if (high_state_count < state_count)
			high_state_count = state_count;

	// visited 리셋
		for (int i = 0; i < N; i++)
			for (int j = 0; j < N; j++)
				visited[i][j] = false;
	// 영역개수 리셋
		state_count = 0;
	}
	

}

int main()
{
	ios::sync_with_stdio(false);
	cin.tie(NULL);
	cout.tie(NULL);
	//지도채우기
	cin >> N;
	for (int i = 0; i < N; i++)
		for (int j = 0; j < N; j++)
		{
			// min value와 max value 나눠서 높이 호출 횟수 줄이기
			min_value = min(min_value, graph[i][j]);
			max_value = max(max_value, graph[i][j]);
			cin >> graph[i][j];
		}
	//solution
	solution();

	//최대영역출력
	cout << high_state_count;
}

